			// maintain the most used words
			var most_used_words = {};

			var translate_readlate_string = function(s) {

				if (s === undefined) {
					return undefined;
				}

				s = s.toLowerCase();

				// split by whitespace, add matching russian words

				// use sentence to sentence translation
				// then word to word for what's remaining
				// like this

				// this is the sentence
				// >w1  >w2  >w3  >w4

				// comma space
				// semicolon space
				// period space
				// space
				// newline
				// tab
				//var words = s.split(' ');
				//console.log('translate_readlate_string()', s);
				var words = s.split(/ \/ |, |; |\. | |\n|\t/);
				//console.log(words);

				//console.log('words.length', words.length);

				var new_text = '';
				var c = 0;
				while (c < words.length) {

					if (words[c] === '') {
						// skip empty
						c++;
						continue;
					}

					var translated_word = '';

					if (lang === 'ru') {

						var l = 0;
						while (l < t_ru.length) {
							if (t_ru[l] === words[c]) {
								translated_word = t_en[l];
								break;
							}
							l++;
						}

					} else {
						// english by default

						var l = 0;
						while (l < t_en.length) {
							if (t_en[l] === words[c]) {
								translated_word = t_ru[l];
								console.log('found translation');
								break;
							}
							l++;
						}

					}

					// order the words by most used
					if (most_used_words[words[c]] === undefined) {
						most_used_words[words[c]] = 0;
					}

					most_used_words[words[c]]++;

					//console.log(c, words[c], translated_word);

					// add words
					if (translated_word === '') {
						// the word was not translated
						new_text += words[c] + ' ';
					} else {
						// show the original word and translated word
						// use white-space: pre to maintain readability
						new_text += '<span style="white-space: pre;">(<span style="display: inline-block;">' + words[c] + '</span><span style="display: inline-block; margin-left: 2px; font-size: .75em; color: #145A32;">' + translated_word + '</span>) </span>';
					}
					c++;
				}

				// remove trailing space character
				new_text = new_text.substring(0, new_text.length-1);

				return s.replace(s, new_text);

			}

			var mod_contents_count = 0;
			// these elements are ready to be translated as they will have no children
			var translate_elements = [];
			// these elements have mixed content
			var mixed_elements = [];
			// this ranks all the others
			var depths = {};

			// recursively modify every element
			var mod_contents = function(ele, depth) {

				mod_contents_count++;
				//console.log('element #' + mod_contents_count + ', depth ' + depth);

				if (String(ele.innerText).length === 0) {
					// no reason to modify
					return;
				}

				// add element to depths
				if (depths[depth] === undefined) {
					depths[depth] = [];
				}

				if (ele.hasChildNodes()) {

					// only nodes with child nodes need to be tested for duplicate content
					depths[depth].push(ele);

					var c = 0;
					while (c < ele.children.length) {
						mod_contents(ele.children[c], depth + 1);
						c++;
					}

				} else {

					// it is safe to modify
					// there are no elements inside
					//console.log('element with no children');
					translate_elements.push(ele);

				}

			}

			mod_contents(document.body, 0);

			// THREE WAYS TO SAY IT

			// remove duplicate content
			// for example, the root node has all the information in it but you cannot simply change it

			// assemble all forks/branches that own no paths as a major node
			// while testing the heiarch for duplicates

			// make sure only the deepest children with the content are modified as .innerText return's child content that it doesn't actually own

			// fastest way is to start at the lowest, or farthest from the root element (same thing)
			// then move up the depths and translate any text that
			// is not within element
			// then translate all the elements that have only text of their own

			var lower_text = '';
			var depth_keys = Object.keys(depths).length-1;
			while (depth_keys > -1) {

				var l = depths[depth_keys];

				for (var p in l) {
					if (l[p].tagName === 'PATH' || l[p].tagName === 'SVG' || l[p].tagName === 'STYLE' || l[p].tagName === 'SCRIPT') {
						// remove svg elements from the lowest start
						//l[p].parentElement.removeChild(l[p]);
						// from translation
						delete l[p];
					}
				}

				//console.log('\ndepth: ' + depth_keys, l);
				//console.log('lower_text', lower_text);

				var current_lower_text = String(lower_text);

				// reset lower_text
				lower_text = '';

				var c = 0;
				while (c < l.length) {

					if (l[c] === undefined) {
						c++;
						continue;
					}

					//console.log(l[c], current_lower_text, l[c].innerText, l[c].children.length);

					if (l[c].innerText != current_lower_text && current_lower_text != '' && l[c].children.length > 0) {

						// innerText will not match because it will add \n where there are child elements that block
						// unless you replace the \n characters
						var diff = String(l[c].innerText).replaceAll('\n', '').replace(current_lower_text, '');
						if (diff.length > 0) {

							// there is text in this element that is not in any child
							// and it is not the lowest
							// and this element has children

							//console.log('non child derived text');
							//console.log(diff.length, diff);

							mixed_elements.push(l[c]);

						}

					} else if (l[c].children.length === 0) {
						// there are no children
						// add to should translate object
						translate_elements.push(l[c]);
					}

					// innerText will not match because it will add \n where there are child elements that block
					// unless you replace the \n characters
					lower_text += String(l[c].innerText).replaceAll('\n', '');

					c++;

				}

				depth_keys--;

			}

			var c = 0;
			while (c < translate_elements.length) {

				// these elements have no children
				// and .innerHTML can be translated and styled
				//translate_elements[c].innerText = 'TRANSLATED';
				translate_elements[c].innerHTML = translate_readlate_string(translate_elements[c].innerText);

				c++;
			}

			var c = 0;
			while (c < mixed_elements.length) {

				// these elements have mixed content, elements and text inside

				// go through .innerHTML and replace the content outside that matches what is in diff
				var m = mixed_elements[c];
				//console.log('\n\nmixed_element', m);

				var text_strings = [];
				var n = 0;
				var cn = mixed_elements[c].childNodes;
				while (n < cn.length) {

					if (cn[n].nodeType === Node.TEXT_NODE) {
						//console.log('text', cn[n].data, cn[n].data.length);
						// TEXT_NODE objects are inserted for block elements
						if (cn[n].data !== '\n') {

							// replace any < or > to parse
							// or make a list of the positions and handle them in the ">" parser
							// the browsers parse each element inside <> to gain the attributes
							cn[n].data = cn[n].data.replaceAll('>', '');
							cn[n].data = cn[n].data.replaceAll('<', '');

							// store each text string to be replaced in order
							text_strings.push(cn[n].data);
						}
					}

					n++;
				}

				// get the .innerHTML as a cloned string
				var s = JSON.parse(JSON.stringify(String(m.innerHTML)));

				// remove comments
				var re = /(?=<!--)([\s\S]*?)-->/gm;
				s = s.replaceAll(re, '');

				// replace the text strings if there are any
				if (text_strings.length > 0) {

					//console.log(text_strings);

					// test if the first text string is at the start in the element
					if (s.indexOf(text_strings[0]) === 0) {
						//console.log('replacing first in text_strings of element', text_strings[0]);
						s = s.replace(text_strings[0], translate_readlate_string(text_strings[0]));
						// remove it so if it is not found here the logic for finding it later works
						text_strings.splice(0, 1);
					}

					// loop through each > to find the next text_strings string
					var text_string_index = 0;
					while (text_string_index < text_strings.length) {

						// get the position of the current last ">text_string"
						var at = s.indexOf('>' + text_strings[text_string_index]);
						var ts = text_strings[text_string_index];

						//console.log(ts, 'found at ' + at);

						// text before the text_string
						var first_part = s.slice(0, at+1);
						//console.log('first_part', first_part);

						// text after the text_string
						var last_part = s.slice(at+1+ts.length);
						//console.log('last_part', last_part);

						// replace the string with the translated html string
						var ns = first_part + translate_readlate_string(ts) + last_part;
						s = ns;

						text_string_index++;
						n++;
					}

				}

				m.innerHTML = s;

				c++;
			}

			// sort most_used_words
			var muw = [];
			for (var w in most_used_words) {
				muw.push({w: w, c: most_used_words[w]});
			}
			muw.sort((firstItem, secondItem) => firstItem.c - secondItem.c);

			var c = 0;
			console.log('words sorted by usage count');
			while (c < muw.length) {
				console.log(muw[c]);
				c++;
			}

